let country = document.getElementById('country');
let division = document.getElementById('division');
let distric = document.getElementById('distric');
let thana = document.getElementById('thana');
let union =  document.getElementById('union');
let word = document.getElementById('word');

window.onload = function(){
    for(let a in countryObject){
        country.options[country.options.length] = new Option(a , a)
    }
}

country.onchange = function(){
    division.length = 1;
    distric.length =1 ;
    thana.length = 1;
    union.length = 1;
    word.length = 1;
   for(let b in countryObject[country.value]){
      division.options[division.options.length] = new Option(b, b)
   }
}

division.onchange = function(){
    distric.length = 1;
    thana.length =1;
    union.length = 1;
    word.length = 1;
    for(let c in countryObject[country.value][division.value]){
        distric.options[distric.options.length] = new Option(c,c)
    }
}

distric.onchange = function(){
    thana.length = 1;
    union.length = 1;
    word.length = 1;
    for(let d in countryObject[country.value][division.value][distric.value]){
        thana.options[thana.options.length] = new Option(d, d)
    }
}


thana.onchange = function(){
    union.length = 1;
    word.length = 1;

    for(let e in countryObject[country.value][division.value][distric.value][thana.value]){
        union.options[union.options.length] = new Option(e , e)
    }
}


union.onchange = function(){
    word.length = 1;
    let z = countryObject[country.value][division.value][distric.value][thana.value][union.value]
    for(let i = 0 ; i < z.length; i++){
        word.options[word.options.length] = new Option(z[i], z[i])
    }
}